webpackJsonp([0x11514e6aa7aef700],{"./node_modules/json-loader/index.js!./.cache/json/git-git-push.json":function(o,n){o.exports={data:{markdownRemark:{html:'<h2>Git Push</h2>\n<p>The <code>git push</code> command allows you to send (or <em>push</em>) the commits from your local branch in your local Git repository to the remote repository.</p>\n<p>To be able to push to your remote repository, you must ensure that <strong>all your changes to the local repository are committed</strong>.</p>\n<p>This command’s syntax is as follows:</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code><span class="token function">git</span> push <span class="token operator">&lt;</span>repo name<span class="token operator">></span> <span class="token operator">&lt;</span>branch name<span class="token operator">></span>\n</code></pre>\n      </div>\n<p>There are a number of different options you can pass with the command, you can learn more about them in the <a href=\'https://git-scm.com/docs/git-push#_options_a_id_options_a\' target=\'_blank\' rel=\'nofollow\'>Git documentation</a> or run <code>git push --help</code>.</p>\n<h3>Push to a Specific Remote Repository and Branch</h3>\n<p>In order to push code, you must first clone a repository to your local machine. </p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code><span class="token comment" spellcheck="true"># Once a repo is cloned, you\'ll be working inside of a `master` branch</span>\n<span class="token function">git</span> clone https://github.com/<span class="token operator">&lt;</span>git-user<span class="token operator">></span>/<span class="token operator">&lt;</span>repo-name<span class="token operator">></span> <span class="token operator">&amp;&amp;</span> <span class="token function">cd</span> <span class="token operator">&lt;</span>repo-name<span class="token operator">></span>\n<span class="token comment" spellcheck="true"># make some changes and commit code</span>\n<span class="token function">git</span> commit -m <span class="token string">"added some changes to my repo!"</span>\n<span class="token comment" spellcheck="true"># push changes in MASTER branch to github</span>\n<span class="token function">git</span> push origin master\n</code></pre>\n      </div>\n<p>To learn more about branches check out the links below:</p>\n<ul>\n<li><a href="https://github.com/renington/guides/blob/master/src/pages/git/git-checkout/index.md">git checkout</a></li>\n<li><a href="https://github.com/renington/guides/blob/master/src/pages/git/git-branch/index.md">git branch</a></li>\n</ul>\n<h3>Push to a Specific Remote Repository and All Branches in it</h3>\n<p>If you want to push all your changes to the remote repository and all branches in it, you can use:</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code><span class="token function">git</span> push --all <span class="token operator">&lt;</span>REMOTE-NAME<span class="token operator">></span>\n</code></pre>\n      </div>\n<p>in which:</p>\n<ul>\n<li><code>--all</code> is the flag that signals that you want to push all branches to the remote repository</li>\n<li><code>REMOTE-NAME</code> is the name of the remote repository you want to push to</li>\n</ul>\n<h3>Push to a specific branch with force parameter</h3>\n<p>If you want to ignore the local changes made to Git repository at Github(Which most of developers do for a hot fix to development server) then you can use —force command to push by ignoring those changs.</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code><span class="token function">git</span> push --force <span class="token operator">&lt;</span>REMOTE-NAME<span class="token operator">></span> <span class="token operator">&lt;</span>BRANCH-NAME<span class="token operator">></span>\n</code></pre>\n      </div>\n<p>in which:</p>\n<ul>\n<li><code>REMOTE-NAME</code> is the name of the remote repository to which you want to push the changes to</li>\n<li><code>BRANCH-NAME</code> is the name of the remote branch you want to push your changes to</li>\n</ul>',fields:{slug:"/git/git-push/"},frontmatter:{title:"Git Push"}}},pathContext:{slug:"/git/git-push/"}}}});
